Template.nav.events({
	'click #signOut':function(e){
		AccountsTemplates.logout();
	}
});

Template.nav.helpers({
    activeIfTemplateIs: function (template) {
      var currentRoute = Router.current();
      return currentRoute &&
        template === currentRoute.lookupTemplate() ? 'active' : '';
    }
  });
